import React, { useState, useEffect } from 'react';
import Chart from 'react-apexcharts';

function App() {
  const [data, setData] = useState({
    series: [{
      name: 'Room Temperature',
      data: [22.5, 22.6, 22.7, 22.8, 22.9]
    }],
    options: {
      chart: {
        type: 'line',
        height: 350
      },
      xaxis: {
        categories: ['10:00', '10:01', '10:02', '10:03', '10:04']
      }
    }
  });

  return (
    <div className="App">
      <h1>Real-Time CoAP Data Plot</h1>
      <Chart options={data.options} series={data.series} type="line" height={350} />
    </div>
  );
}

export default App;
